  `id` int(11) NOT NULL COMMENT '主键',
  `version_type` smallint(6) NOT NULL COMMENT '版本类型  1-开发版本  2-审核版本  3-线上版本',
  `app_id` varchar(50) NOT NULL COMMENT 'appId',
  `store_id` int(11) DEFAULT NULL COMMENT '商家ID',
