  `code_desc` varchar(150) NOT NULL COMMENT '代码描述',
  `status` smallint(6) DEFAULT NULL COMMENT '状态：1-提交/审核中 2-成功 3-失败',
  `auditid` int(11) DEFAULT NULL COMMENT '提交审核后返回的auditid',
  `action` varchar(20) DEFAULT NULL COMMENT '上线版本是否可见：close为不可见，open为可见',
  `fail_reason` varchar(150) DEFAULT NULL COMMENT '失败原因',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建用户',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改用户',
