-- ----------------------------
-- Table structure for jc_order
-- ----------------------------
DROP TABLE IF EXISTS `jc_order`;
CREATE TABLE `jc_order` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '所属店铺',
  `order_code` varchar(100) NOT NULL COMMENT '订单编号',
  `merge_order_code` varchar(100) NOT NULL COMMENT '合并支付订单号（未拆单情况下与订单号一致;已拆单情况下，与订单号不一致，但多笔子订单的合并支付订单号是一致）',
  `out_trade_num` varchar(100) DEFAULT NULL COMMENT '外部交易流水号',
  `order_source` smallint(6) NOT NULL DEFAULT '0' COMMENT '订单来源 1pc  2 移动端h5 3APP  4 微信客户端H5  5小程序（微信小程序）',
  `pay_source` smallint(6) DEFAULT NULL COMMENT '支付来源 1pc  2 移动端h5 3APP  4 微信客户端H5  5小程序（微信小程序）',
  `member_id` int(11) NOT NULL COMMENT '会员ID',
  `is_new_member` tinyint(1) NOT NULL COMMENT '是否新用户',
  `new_refund_id` int(11) DEFAULT '0' COMMENT '最新售后ID',
  `status` smallint(6) NOT NULL DEFAULT '0' COMMENT '订单状态(1待付款 2待发货 3待收货 4已完成 5已取消 6超时交易关闭 )',
  `comment_status` smallint(6) DEFAULT NULL COMMENT '评价状态 1-待评价  2-已评价  3-对方已评  4-双方已评',
  `user_del` smallint(6) NOT NULL DEFAULT '0' COMMENT '用户删除(0未删除 1回收站 2删除)',
  `pay_mode` smallint(6) DEFAULT NULL COMMENT '支付方式( 1支付宝 2微信  3银联 4余额)',
  `order_time` datetime NOT NULL COMMENT '下单时间',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `delivery_time` datetime DEFAULT NULL COMMENT '发货时间',
  `receive_time` datetime DEFAULT NULL COMMENT '成交时间(收货时间)',
  `order_type` smallint(6) NOT NULL DEFAULT '0' COMMENT '订单类型(1实物订单 2虚拟订单)',
  `total_weight` float(11,2) DEFAULT NULL COMMENT '商品总重量',
  `order_total_amount` decimal(11,2) DEFAULT NULL COMMENT '订单总金额（商品原价含运费）',
  `order_product_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '订单优惠后总金额（不含运费）',
  `order_amount` decimal(11,2) DEFAULT NULL COMMENT '订单优惠后总金额(含运费)',
  `order_pay_amount` decimal(11,2) DEFAULT NULL COMMENT '实际支付金额(抵扣红包、积分金额)',
  `order_freight` decimal(11,2) DEFAULT NULL COMMENT '订单总运费',
  `seller_discount` decimal(11,2) DEFAULT NULL COMMENT '卖家优惠总金额',
  `platform_discount` decimal(11,2) DEFAULT NULL COMMENT '平台优惠优惠券金额',
  `integral_discount` decimal(11,2) DEFAULT NULL COMMENT '积分抵扣',
  `use_integral` int(11) NOT NULL DEFAULT '0' COMMENT '使用积分数',
  `use_red_packet` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '使用红包',
  `red_packet_discount` decimal(11,2) DEFAULT NULL COMMENT '红包抵扣',
  `refund_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '退款金额',
  `send_integral` int(11) DEFAULT NULL COMMENT '积分赠送',
  `sys_receive_time` datetime DEFAULT NULL COMMENT '系统自动收货时间',
  `has_extend_receive` tinyint(1) DEFAULT NULL COMMENT '是否已延长收货',
  `edit_price_time` datetime DEFAULT NULL COMMENT '商家改价格时间',
  `product_count` int(11) NOT NULL DEFAULT '0' COMMENT '商品总数',
  `refund_count` int(11) NOT NULL DEFAULT '0' COMMENT '退回商品总数',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `platform_coupon_id` int(11) DEFAULT NULL COMMENT '平台优惠券ID',
  `store_coupon_id` int(11) DEFAULT NULL COMMENT '使用店铺优惠券ID',
  `remind_time` datetime DEFAULT NULL COMMENT '最新一次提醒时间',
  `remind_count` tinyint(1) DEFAULT NULL COMMENT '提醒次数（最多只能是5次）',
  `location_ip` varchar(50) DEFAULT NULL COMMENT '下单ip',
  `location_country` varchar(50) DEFAULT NULL COMMENT '下单国家',
  `location_province` varchar(50) DEFAULT NULL COMMENT '下单省份',
  `location_city` varchar(50) DEFAULT NULL COMMENT '下单城市',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_order_type` (`order_type`) USING BTREE,
  KEY `index_jc_order_order_time` (`order_time`) USING BTREE,
  KEY `index_jc_order_status` (`status`) USING BTREE,
  KEY `index_jc_order_new_member` (`is_new_member`) USING BTREE,
  KEY `index_jc_order_member` (`member_id`) USING BTREE,
  KEY `index_jc_order_source` (`order_source`) USING BTREE,
  KEY `index_jc_order_code` (`order_code`) USING BTREE,
  KEY `index_jc_order_store` (`store_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单表';

-- ----------------------------
-- Records of jc_order
-- ----------------------------

