  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `product_count` int(11) NOT NULL COMMENT '商品数量',
  `return_count` int(11) NOT NULL COMMENT '已退商品数量',
  `return_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '已退商品金额',
  `refund_status` smallint(6) NOT NULL DEFAULT '0' COMMENT '售后状态 0无 1部分退款 2全部退款 3部分换货 4全部换货 5部分退货退款 6全部退货退款 7综合售后',
  `new_refund_id` int(11) DEFAULT NULL COMMENT '最新售后ID',
  `product_weight` decimal(11,2) DEFAULT NULL COMMENT '重量',
  `product_price` decimal(11,2) DEFAULT NULL COMMENT '商品单价',
  `real_price` decimal(11,2) DEFAULT NULL COMMENT '商品实际成交单价',
  `product_freight` decimal(11,2) DEFAULT NULL COMMENT '商品运费',
  `discount_amount` decimal(11,2) DEFAULT NULL COMMENT '商品优惠金额（含运费优惠）',
  `platform_discount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '平台优惠券折扣金额',
  `integral_discount` decimal(11,2) DEFAULT NULL COMMENT '商品积分抵扣金额',
  `use_integral` int(11) NOT NULL COMMENT '使用积分数',
  `use_red_packet` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '使用红包值',
  `red_packet_discount` decimal(11,2) DEFAULT NULL COMMENT '单件商品红包抵扣',
  `real_amount` decimal(11,2) DEFAULT NULL COMMENT '商品小计实际成交金额(扣除优惠分摊后的价格)不含运费',
  `pay_amount` decimal(11,2) DEFAULT NULL COMMENT '商品小计实际用户支付金额(成交金额-积分抵扣-红包抵扣)不含运费',
  `product_service` varchar(255) DEFAULT NULL COMMENT '商品服务',
  `is_give` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否赠品',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_jc_order_item_sku` (`product_sku_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单项';

-- ----------------------------
-- Records of jc_order_item
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_item_product
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_item_product`;
CREATE TABLE `jc_order_item_product` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `product_id` int(11) NOT NULL COMMENT '商品Id',
  `product_sku_id` int(11) DEFAULT NULL COMMENT '商品SKU ID',
  `product_name` varchar(150) NOT NULL COMMENT '商品名称',
  `brief_introduction` varchar(500) DEFAULT NULL COMMENT '商品简介',
  `sku_attr` varchar(3000) DEFAULT NULL COMMENT '销售属性',
  `cover_image` int(11) DEFAULT NULL COMMENT '商品封面图',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_order_item_sku` (`product_sku_id`) USING BTREE,
  KEY `index_jc_order_item_product` (`product_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商品快照';

-- ----------------------------
-- Records of jc_order_item_product
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_product_service
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_product_service`;
CREATE TABLE `jc_order_product_service` (
  `order_item_id` int(11) NOT NULL COMMENT '订单项ID',
  `service_id` int(11) NOT NULL COMMENT '服务ID'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商品服务';

-- ----------------------------
-- Records of jc_order_product_service
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_promote
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_promote`;
CREATE TABLE `jc_order_promote` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `order_id` int(11) NOT NULL COMMENT '订单ID',
  `coupon_id` int(11) DEFAULT NULL COMMENT '优惠券(平台优惠)',
  `discount_id` int(11) DEFAULT NULL COMMENT '满减项(平台优惠)',
  `promote_id` int(11) DEFAULT NULL COMMENT '活动ID',
  `discount_amount` decimal(11,2) DEFAULT NULL COMMENT '活动优惠金额',
  `order_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `order_join_amount` decimal(11,2) DEFAULT NULL COMMENT '参与平台的订单商品金额',
  `is_platform` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否平台促销',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺ID',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_jc_order_promote_discount` (`discount_id`) USING BTREE,
  KEY `index_jc_order_promote_coupon` (`coupon_id`) USING BTREE,
  KEY `index_jc_order_promote_order` (`order_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单享受优惠表';

-- ----------------------------
-- Records of jc_order_promote
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_refund
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_refund`;
CREATE TABLE `jc_order_refund` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `order_id` int(11) NOT NULL COMMENT '订单ID',
  `order_item_id` int(11) NOT NULL COMMENT '订单项ID',
  `store_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `member_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `product_id` int(11) NOT NULL COMMENT '商品ID',
  `product_sku_id` int(11) DEFAULT NULL COMMENT '商品SKU ID',
  `order_status` smallint(6) NOT NULL DEFAULT '0' COMMENT '申请时订单状态',
  `product_refund_count` int(11) NOT NULL COMMENT '退货商品数量',
  `order_refund_num` varchar(50) NOT NULL COMMENT '退款退货编号',
  `refund_type` smallint(6) NOT NULL COMMENT '售后类型(1仅退款 2退款退货 3换货 )',
  `product_status` smallint(6) DEFAULT NULL COMMENT '货物状态(1未收到货 2已收到货)',
  `apply_refund_type` smallint(6) NOT NULL COMMENT '发起售后类型(1售中,2售后)',
  `refund_reason` varchar(150) DEFAULT NULL COMMENT '退款原因',
  `status` smallint(6) NOT NULL DEFAULT '0' COMMENT '处理状态(0-待卖家确认 1退款中 2卖家拒绝 4待买家发货 5待卖家收货 6待买家收货 7待卖家发货 8已完成 9买家取消）',
  `refund_amount` decimal(11,2) DEFAULT NULL COMMENT '申请退款金额(用户支付金额)',
  `apply_time` datetime NOT NULL COMMENT '申请时间',
  `finish_time` datetime DEFAULT NULL COMMENT '售后完成时间',
  `check_time` datetime DEFAULT NULL COMMENT '审核时间',
  `check_reason` varchar(150) DEFAULT NULL COMMENT '审核说明',
  `seller_address` varchar(150) DEFAULT NULL COMMENT '卖家收货地址',
  `seller_name` varchar(50) DEFAULT NULL COMMENT '卖家收货人姓名',
  `seller_tel` varchar(50) DEFAULT NULL COMMENT '卖家收货人电话',
  `postal_code` varchar(20) DEFAULT NULL COMMENT '卖家邮政编码',
  `customer_txt` varchar(150) DEFAULT NULL COMMENT '买家留言',
  `seller_txt` varchar(150) DEFAULT NULL COMMENT '卖家留言',
  `seller_express_num` varchar(50) DEFAULT NULL COMMENT '卖家回寄商品运单编号',
  `seller_express_company` int(11) DEFAULT NULL COMMENT '卖家回寄商品快递公司',
  `customer_express_num` varchar(50) DEFAULT NULL COMMENT '买家寄送快递运单编号',
  `customer_express_company` int(11) DEFAULT NULL COMMENT '买家回寄商品快递公司',
  `platform_intervent` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否申请平台介入',
  `last_intervent_id` int(11) DEFAULT NULL COMMENT '最新申请介入ID',
  `refund_status` smallint(6) DEFAULT NULL COMMENT '退款状态 1-退款中 2-退款成功  3-退款失败',
  `refund_fail_reason` varchar(150) DEFAULT NULL COMMENT '退款失败原因（记录第三方支付返回的支付失败原因）',
  `refund_integral` int(11) DEFAULT NULL COMMENT '退回积分值',
  `refund_integral_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '退回积分抵扣金额',
  `refund_red_packet` decimal(11,2) DEFAULT NULL COMMENT '退回红包值',
  `refund_red_packet_amount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '退回红包抵扣金额',
  `refund_platform_discount` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '退回平台优惠券折扣金额',
  `customer_name` varchar(50) DEFAULT NULL COMMENT '换货买家联系人',
  `customer_tel` varchar(50) DEFAULT NULL COMMENT '换货买家电话',
  `customer_address` varchar(500) DEFAULT NULL COMMENT '换货买家地址',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_jc_order_refund_invent` (`platform_intervent`) USING BTREE,
  KEY `index_jc_order_refund_status` (`status`) USING BTREE,
  KEY `index_jc_order_refund_code` (`order_refund_num`) USING BTREE,
  KEY `index_jc_order_refund_type` (`refund_type`) USING BTREE,
  KEY `index_jc_order_refund_sku` (`product_sku_id`) USING BTREE,
  KEY `index_jc_order_refund_order` (`order_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单退款退货表';

-- ----------------------------
-- Records of jc_order_refund
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_refund_detail
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_refund_detail`;
CREATE TABLE `jc_order_refund_detail` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `order_refund_id` int(11) NOT NULL COMMENT '售后ID',
  `member_id` int(11) DEFAULT NULL COMMENT '会员ID',
  `store_user_id` int(11) DEFAULT NULL COMMENT '店铺用户ID',
  `core_user_id` int(11) DEFAULT NULL COMMENT '平台用户ID',
  `operate_txt` varchar(500) NOT NULL COMMENT '操作内容',
  `operate_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '操作类型(1卖家同意 2卖家拒绝 3申请撤回 4平台介入处理中 5买家已发货 6卖家确认收货 7 卖家已发货 8买家确认收货9修改售后申请 )',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_order_refund_detail_refund` (`order_refund_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='售后操作记录';

-- ----------------------------
-- Records of jc_order_refund_detail
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_refund_intervent
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_refund_intervent`;
CREATE TABLE `jc_order_refund_intervent` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `order_refund_id` int(11) NOT NULL COMMENT '售后ID',
  `member_id` int(11) DEFAULT NULL COMMENT '会员ID',
  `store_user_id` int(11) DEFAULT NULL COMMENT '店铺用户ID',
  `core_user_id` int(11) DEFAULT NULL COMMENT '平台操作用户ID',
  `apply_intervent_type` smallint(6) DEFAULT NULL COMMENT '申请平台介入类型(1未收到货 2卖家拒绝)',
  `intervent_reason` varchar(150) DEFAULT NULL COMMENT '申请接入原因',
  `intervent_time` datetime DEFAULT NULL COMMENT '平台处理时间',
  `platform_status` smallint(6) NOT NULL DEFAULT '1' COMMENT '平台介入处理状态（ 0待确认1-确认通过 2-确认不通过',
  `intervent_result` varchar(500) DEFAULT NULL COMMENT '介入结果说明',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='申请平台介入';

-- ----------------------------
-- Records of jc_order_refund_intervent
-- ----------------------------

-- ----------------------------
-- Table structure for jc_order_refund_pic
-- ----------------------------
DROP TABLE IF EXISTS `jc_order_refund_pic`;
CREATE TABLE `jc_order_refund_pic` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `order_refund_id` int(11) NOT NULL COMMENT '退款退货订单ID',
  `pic_id` int(11) NOT NULL COMMENT '上传图片资源ID',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_jc_order_refund_pic` (`order_refund_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='退款退货附图';

-- ----------------------------
-- Records of jc_order_refund_pic
-- ----------------------------

-- ----------------------------
-- Table structure for jc_product
-- ----------------------------
DROP TABLE IF EXISTS `jc_product`;
CREATE TABLE `jc_product` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '所属店铺',
  `category_id` int(11) NOT NULL COMMENT '商品关联所属分类',
  `store_pro_category_id` int(11) DEFAULT NULL COMMENT '店铺内商品分类',
  `item_code` varchar(20) NOT NULL COMMENT '商品信息的唯一编码。本字段是从业务角度考虑的，相当于全局的唯一业务主键。',
  `product_name` varchar(150) NOT NULL COMMENT '商品名称(标题显示的名称)。',
  `brief_introduction` varchar(500) DEFAULT NULL COMMENT '商品简介',
  `brief_introduction_color` varchar(20) DEFAULT NULL COMMENT '商品简介显示颜色值',
  `virtual_card_template_id` int(11) DEFAULT NULL COMMENT '虚拟卡密模板id;只有当商品类型为虚拟情况时才有此值',
  `sell_goods_sale` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为销售商品出售  true是   false否',
  `is_invoice` tinyint(1) NOT NULL DEFAULT '0' COMMENT ' 是否提供发票    true是   false否',
  `product_status` smallint(6) NOT NULL DEFAULT '1' COMMENT '商品状态,0-仓库中  1-待审核  2- 审核不通过  3-出售中(审核通过、上架)  4-下架（违规下架）  5 -回收站 ',
  `refuse_reason` varchar(150) DEFAULT NULL COMMENT '审核不通过原因',
  `accessories_recommen` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否含有配件或推荐组合   true是   false否',
  `giveaway` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否含有赠品   true是   false否',
  `is_sku` tinyint(1) NOT NULL DEFAULT '0' COMMENT '启用商品规格   true是   false否',
  `item_number` varchar(100) DEFAULT NULL COMMENT '货号',
  `brand_id` int(11) DEFAULT NULL COMMENT '关联的品牌id',
  `sales_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '销售价',
  `market_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '市场价',
  `cost_price` decimal(12,2) DEFAULT '0.00' COMMENT '成本价',
  `inventory` int(11) NOT NULL DEFAULT '1' COMMENT '库存量',
  `inventory_warning_value` int(11) DEFAULT '0' COMMENT '库存预警值',
  `templete_id` int(11) NOT NULL COMMENT '关联的运费模板id',
  `weight` float(11,2) DEFAULT NULL COMMENT '重量',
  `volume` float(11,2) DEFAULT NULL COMMENT '体积',
  `shelf_time` datetime DEFAULT NULL COMMENT '上架时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品信息主体表';

-- ----------------------------
-- Records of jc_product
-- ----------------------------

-- ----------------------------
-- Table structure for jc_product_attr
-- ----------------------------
DROP TABLE IF EXISTS `jc_product_attr`;
CREATE TABLE `jc_product_attr` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `product_id` int(11) NOT NULL COMMENT '所属商品id',
  `product_type_id` int(11) NOT NULL COMMENT '商品类型id',
  `type_attr_group_name` varchar(150) DEFAULT NULL COMMENT '商品类型属性组名称',
  `type_attr_id` int(11) NOT NULL COMMENT '商品规格属性id',
  `type_attr_name` varchar(150) DEFAULT NULL COMMENT '商品规格属性名称',
  `type_attr_vc` varchar(150) DEFAULT NULL COMMENT '商品规格属性值code或输入值',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品属性表';

-- ----------------------------
-- Records of jc_product_attr
-- ----------------------------

-- ----------------------------
-- Table structure for jc_product_brand
-- ----------------------------
DROP TABLE IF EXISTS `jc_product_brand`;
CREATE TABLE `jc_product_brand` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) DEFAULT NULL COMMENT '申请店铺id',
  `brand_name` varchar(150) NOT NULL COMMENT '品牌名称',
  `en_name` varchar(150) DEFAULT NULL COMMENT '英文名字',
  `initials` varchar(50) NOT NULL COMMENT '首字母',
  `logo_id` int(11) NOT NULL COMMENT 'logo图路径,引用图片空间资源id',
  `sort_num` int(11) NOT NULL DEFAULT '10' COMMENT '排序值',
  `is_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示    true显示   false不显示',
  `url` varchar(500) DEFAULT NULL COMMENT '网址',
  `status` smallint(6) NOT NULL DEFAULT '1' COMMENT '状态 1、待提交 2、审核中（待审核）3、审核不通过 4、审核通过',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `brand_profile` longtext COMMENT '品牌简介',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='品牌信息主体表';

-- ----------------------------
-- Records of jc_product_brand
-- ----------------------------

-- ----------------------------
-- Table structure for jc_product_category
-- ----------------------------
DROP TABLE IF EXISTS `jc_product_category`;
CREATE TABLE `jc_product_category` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `cate_name` varchar(150) NOT NULL COMMENT '分类名称',
  `name_alias` varchar(150) DEFAULT NULL COMMENT '分类别名',
  `parent_id` int(11) DEFAULT NULL COMMENT '上级分类id',
  `lft` int(11) NOT NULL COMMENT '分类树左边',
  `rgt` int(11) NOT NULL COMMENT '分类树右边',
  `bond_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '保证金',
  `commission_rate` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '佣金比例',
  `is_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示  true显示    false不显示',
  `is_virtual` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为虚拟分类  true是   false不是',
  `template_path` varchar(150) DEFAULT NULL COMMENT '分类模板',
  `product_type_id` int(11) NOT NULL COMMENT '关联的商品类型id',
  `icon_id` int(11) DEFAULT NULL COMMENT '分类图标路径,引用图片空间资源id',
  `cate_title` varchar(150) DEFAULT NULL COMMENT '分类页标题',
