  `store_id` int(11) NOT NULL COMMENT '商家ID',
  `tpl_id` int(11) NOT NULL COMMENT '关联的商品虚拟卡密模板id',
  `sku_code` varchar(50) NOT NULL COMMENT 'sku编号',
  `key_val` varchar(150) NOT NULL COMMENT 'key值',
  `card_data` varchar(500) NOT NULL COMMENT '卡密数据（json数据，实例数据 [{''sku'':''3492734923'',''value'':''4237898492374'',''no'':''4234234233''}]）',
  `card_status` smallint(6) NOT NULL DEFAULT '1' COMMENT '卡密状态 1：未使用 2：已使用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品虚拟卡密数据表';

-- ----------------------------
-- Records of jc_product_virtual_card_data
