  `total` int(11) NOT NULL DEFAULT '0' COMMENT '总共数据数量',
  `strut_content` varchar(150) DEFAULT NULL COMMENT '模板结构（json数据，实例数据 [{''key'':''sku'',''label'':''SKU编号'',''is_require'':true}]）',
  `create_time` datetime NOT NULL COMMENT '创建时间',
