DROP TABLE IF EXISTS `jc_promote`;
CREATE TABLE `jc_promote` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) DEFAULT NULL COMMENT '所属店铺',
  `is_platform_promote` tinyint(1) DEFAULT NULL COMMENT '是否平台活动',
  `promote_type` smallint(6) NOT NULL DEFAULT '0' COMMENT '活动类型(1 单品折扣  2 单品一口价  3 满减  4 优惠券  5满赠  6包邮)',
  `name` varchar(150) NOT NULL COMMENT '活动名称',
  `remark` varchar(255) DEFAULT NULL COMMENT '活动说明',
  `promote_begin_time` datetime NOT NULL COMMENT '活动开始时间',
  `promote_end_time` datetime NOT NULL COMMENT '活动截止时间',
  `con_product_num` int(11) DEFAULT NULL COMMENT '活动条件-商品数量',
  `con_order_amount` int(11) DEFAULT NULL COMMENT '活动条件-订单金额',
  `con_type` smallint(6) DEFAULT NULL COMMENT '活动条件-类型(1 满多少 2 每满多少 3第几件)',
  `discount_amount` int(11) DEFAULT NULL COMMENT '活动优惠金额',
  `discount_mode` smallint(6) DEFAULT NULL COMMENT '活动优惠类型(1订单满减 2订单赠品 3订单赠优惠券 4包邮 5支付减 6单品优惠 7订单使用优惠券)',
  `promote_scope` smallint(6) NOT NULL COMMENT '活动范围(1全部商品 2部分类目 3部分商品  4排除部分商品)',
  `product_flag_icon` int(11) DEFAULT NULL COMMENT '活动商品标识图',
  `is_enable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启',
  `sort_num` int(11) NOT NULL DEFAULT '10' COMMENT '排序',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_promote_enable` (`is_enable`),
  KEY `index_jc_promote_type` (`promote_type`),
  KEY `index_jc_promote_is_platform` (`is_platform_promote`),
  KEY `index_jc_promote_store` (`store_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='活动基本表';

-- ----------------------------
-- Records of jc_promote
-- ----------------------------

