-- ----------------------------
-- Table structure for jc_promote_coupon
-- ----------------------------
DROP TABLE IF EXISTS `jc_promote_coupon`;
CREATE TABLE `jc_promote_coupon` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `promote_id` int(11) DEFAULT NULL COMMENT '活动ID',
  `store_id` int(11) DEFAULT '0' COMMENT '所属店铺',
  `is_platform_coupon` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否平台优惠券',
  `coupon_type` smallint(6) NOT NULL COMMENT '优惠券类型(1 活动优惠券 2 普通优惠券 活动优惠券则费用由卖家承担，普通优惠券谁发行谁承担)',
  `name` varchar(150) NOT NULL COMMENT '优惠券名称',
  `use_begin_time` datetime DEFAULT NULL COMMENT '优惠券开始时间',
  `use_end_time` datetime DEFAULT NULL COMMENT '优惠券截止时间',
  `use_day` smallint(6) DEFAULT NULL COMMENT '自领取日有效天数',
  `expirate_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '优惠券使用时间类型(1时间范围  2固定天数)',
  `con_order_amount` decimal(11,2) DEFAULT NULL COMMENT '使用条件-订单金额',
  `discount_amount` decimal(11,2) DEFAULT NULL COMMENT '优惠卷金额',
  `issue_num` int(11) NOT NULL COMMENT '发放数量(0无限制)',
  `get_mode` smallint(6) NOT NULL DEFAULT '0' COMMENT '发放形式(1用户领取 2满赠 3其他方式赠送)',
  `get_num` smallint(6) NOT NULL COMMENT '每账户领取数量',
  `coupon_scope` smallint(4) NOT NULL DEFAULT '1' COMMENT '活动范围(1全部商品 3部分类目)',
  `sort_num` int(11) NOT NULL DEFAULT '10' COMMENT '排序',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_coupon_promote` (`promote_id`),
  KEY `index_jc_coupon_store` (`store_id`),
  KEY `index_jc_coupon_platform` (`is_platform_coupon`),
  KEY `index_jc_coupon_type` (`coupon_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券表';

