  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `promote_id` varchar(255) DEFAULT NULL COMMENT '活动ID',
  `order_amount` decimal(11,2) DEFAULT NULL COMMENT '优惠券订单总成交额',
  `order_discount_amount` decimal(11,2) DEFAULT NULL COMMENT '优惠券总金额',
  `order_num` int(11) DEFAULT NULL COMMENT '使用优惠券总订单量',
  `order_avg_amount` decimal(11,2) DEFAULT NULL COMMENT '使用优惠券订单平均价(活动期优惠订单总成交额 / 使用该优惠的付款订单总数)',
  `new_user_num` int(11) DEFAULT NULL COMMENT '拉新数(活动期使用该优惠券订单标记为新用户的数量)',
  `use_count` int(11) DEFAULT NULL COMMENT '使用数量',
  `get_count` int(11) DEFAULT NULL COMMENT '领取数量',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
