  `promote_id` int(11) NOT NULL DEFAULT '0' COMMENT '活动ID',
  `sign_scope` smallint(6) NOT NULL DEFAULT '0' COMMENT '报名限制范围(1全部商家 2自营商家  3部分类目)',
  `sign_begin_time` datetime NOT NULL COMMENT '报名开始时间',
  `sign_end_time` datetime NOT NULL COMMENT '报名截止时间',
  `one_fee_self` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '自营店铺单品报名费用',
  `one_fee_third` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '非自营店铺单品报名费用',
  `min_price` float(11,2) DEFAULT '0.00' COMMENT '最近30天最低成交价要求',
  `min_stock` int(11) DEFAULT '10' COMMENT '库存量要求',
  `min_score` float(11,2) DEFAULT '0.00' COMMENT '商品评分最低要求',
  `max_refund_rate` float(11,2) DEFAULT '0.00' COMMENT '最大退款率',
  `min_sale` int(11) DEFAULT '10' COMMENT '最近30天销量最小要求',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
