  `promote_type` smallint(6) NOT NULL DEFAULT '0' COMMENT '服务项目(1 单品折扣  2 单品一口价  3 满减  4 优惠券  5满赠  6包邮)',
  `order_amount` decimal(11,2) DEFAULT NULL COMMENT '成交价格',
