DROP TABLE IF EXISTS `jc_promote_sign`;
CREATE TABLE `jc_promote_sign` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `promote_id` int(11) NOT NULL COMMENT '活动ID',
  `store_id` int(11) NOT NULL COMMENT '所属店铺',
  `store_account_id` int(11) NOT NULL DEFAULT '0' COMMENT '报名人',
  `sign_time` datetime NOT NULL COMMENT '报名时间',
  `sign_amount` float(11,2) NOT NULL COMMENT '报名费用',
  `order_num` varchar(100) DEFAULT NULL COMMENT '内部流水号',
  `order_out_num` varchar(100) DEFAULT NULL COMMENT '报名支付流水',
  `sign_order_account` varchar(100) DEFAULT NULL COMMENT '报名支付账户',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `order_mode` smallint(6) DEFAULT NULL COMMENT '支付方式(1银联2 支付宝 3微信)',
  `sign_status` smallint(6) NOT NULL DEFAULT '0' COMMENT '报名状态(0报名待审核 1已审核待支付 2已支付报名成功 3拒绝 4撤回)',
  `sign_check_user_id` int(11) DEFAULT NULL COMMENT '报名受理退回处理人',
  `sign_check_time` datetime DEFAULT NULL COMMENT '报名受理时间',
  `sort_num` int(11) NOT NULL DEFAULT '10' COMMENT '排序',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL COMMENT '是否删除（0-否  1-是）',
  PRIMARY KEY (`id`),
  KEY `index_jc_promote_sign_status` (`sign_status`),
  KEY `index_jc_promote_sign_store` (`store_id`),
  KEY `index_jc_promote_sign` (`promote_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='平台活动报名表';

-- ----------------------------
-- Records of jc_promote_sign
-- ----------------------------

