-- ----------------------------
-- Table structure for jc_store
-- ----------------------------
DROP TABLE IF EXISTS `jc_store`;
CREATE TABLE `jc_store` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `member_id` int(11) NOT NULL COMMENT '关联开店会员id',
  `store_name` varchar(150) NOT NULL COMMENT '店铺名称',
  `logo_id` int(11) DEFAULT NULL COMMENT 'logo资源ID',
  `head_img_id` int(11) DEFAULT NULL COMMENT '店铺头像',
  `store_username` varchar(150) NOT NULL COMMENT '商家账户',
  `contact_name` varchar(150) NOT NULL COMMENT '联系人姓名',
  `contact_mail` varchar(60) NOT NULL COMMENT '联系人邮箱',
  `contact_mobile` varchar(11) NOT NULL COMMENT '联系人手机',
  `status` smallint(6) NOT NULL COMMENT '状态  1-营业中  2-暂停营业  3-关闭/禁止营业',
  `is_self_shop` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否自营店铺 true是   false不是',
  `store_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '店铺类型;暂时有(1个人店铺,2企业店铺等)',
  `sale_cate_id` int(11) DEFAULT NULL COMMENT '主营类目',
  `sale_cate_bond` decimal(12,2) DEFAULT NULL COMMENT '主营类目保证金（只记录当时申请入住是的金额）',
  `level_id` int(11) DEFAULT NULL COMMENT '店铺等级（由店铺经验值决定）',
  `free_pay_status` smallint(6) NOT NULL COMMENT '入住费用缴费状态 1-未支付  2-已支付',
  `free_pay_type` smallint(6) DEFAULT NULL COMMENT '支付方式(1-支付宝  2-微信 3-银联)',
  `audit_results` smallint(6) NOT NULL DEFAULT '1' COMMENT '审核结果;一般情况平台自营店铺默认通过。普通店铺需要审核；1待审核2审核通过3审核不通过',
  `audit_opinion` varchar(500) DEFAULT NULL COMMENT '审核意见',
  `is_wechat_enable` tinyint(1) NOT NULL COMMENT '是否开启微信公众号： 0-否  1-是',
  `is_product_audit_enable` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启店铺商品上架审核（自营商家默认是1）; 0-否 1-是',
  `domain_name` varchar(150) DEFAULT NULL COMMENT '二级域名',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺主体信息表';

-- ----------------------------
-- Records of jc_store
-- ----------------------------

