  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺动态记录表';

-- ----------------------------
-- Records of jc_store_dynamic
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_express_tpl
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_express_tpl`;
CREATE TABLE `jc_store_express_tpl` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '关联的店铺id',
  `express_name` varchar(150) NOT NULL COMMENT '运费模版名称',
  `is_free` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否包邮(0-否  1-是)',
  `tpl_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '计价方式。1 件数 2体积 3重量',
  `create_time` datetime NOT NULL COMMENT '创建日期',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='运费模板表，商品用于关联的运费模板';

-- ----------------------------
-- Records of jc_store_express_tpl
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_express_tpl_detail
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_express_tpl_detail`;
CREATE TABLE `jc_store_express_tpl_detail` (
  `id` int(11) NOT NULL COMMENT '主键id',
  `freight_id` int(11) NOT NULL COMMENT '关联的运费模板ID。',
  `delivery_way` smallint(6) NOT NULL DEFAULT '1' COMMENT '配送方式；1快递,2ems,3平邮',
  `districtId_list` varchar(3000) DEFAULT NULL COMMENT '配送区域集合。',
  `first_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '首次价格',
  `first_num` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '首次（件数情况默认件数）（重量情况默认千克）（体积情况默认体积，立方米）',
  `add_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '续件价格',
  `add_num` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '续加（件数情况默认件数）（重量情况默认千克）（体积情况默认体积，立方米）',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认运费  true 是      false 否',
  `create_time` datetime NOT NULL COMMENT '创建日期',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='物流运费模板详情表，记录各区域的物流费用，计价方式';

-- ----------------------------
-- Records of jc_store_express_tpl_detail
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_info
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_info`;
CREATE TABLE `jc_store_info` (
  `id` int(11) NOT NULL COMMENT '店铺ID',
  `company_name` varchar(150) DEFAULT NULL COMMENT '公司名称',
  `province_name` varchar(150) DEFAULT NULL COMMENT '公司所在地-省级',
  `city_name` varchar(150) DEFAULT NULL COMMENT '公司所在地-市级',
  `area_name` varchar(150) DEFAULT NULL COMMENT '公司所在地-县级',
  `province_code` varchar(150) DEFAULT NULL COMMENT '公司所在地-省级id',
  `city_code` varchar(150) DEFAULT NULL COMMENT '公司所在地-市级id',
  `area_code` varchar(150) DEFAULT NULL COMMENT '公司所在地-县级id',
  `address` varchar(500) DEFAULT NULL COMMENT '详细地址',
  `mobile` varchar(13) DEFAULT NULL COMMENT '公司电话',
  `bl_no` varchar(100) DEFAULT NULL COMMENT '营业执照注册号',
  `bl_province_name` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-省级',
  `bl_city_name` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-市级',
  `bl_area_name` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-县级',
  `bl_province_code` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-省级id',
  `bl_city_code` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-市级id',
  `bl_area_code` varchar(150) DEFAULT NULL COMMENT '营业执照所在地-县级id',
  `bl_start_time` date DEFAULT NULL COMMENT '营业期限-开始时间',
  `bl_end_time` date DEFAULT NULL COMMENT '营业期限-截止时间',
  `registered_capital` decimal(12,2) DEFAULT '0.00' COMMENT '注册资本',
  `setup_date` date DEFAULT NULL COMMENT '成日日期',
  `legal_name` varchar(150) NOT NULL COMMENT '企业店铺法人姓名；个人店铺姓名',
  `legal_idcard` char(18) DEFAULT NULL COMMENT '企业店铺法人身份证号；个人店铺身份证号',
  `idcard_positive_photo` varchar(150) DEFAULT NULL COMMENT '法人身份证正面照片；个人店铺身份证正面照片',
  `idcard_reverse_photo` varchar(150) DEFAULT NULL COMMENT '法人身份证反面照片；个人店铺身份证反面照片',
  `photo` varchar(150) DEFAULT NULL COMMENT '法人手持身份证照；个人店铺手持身份证照',
  `bl_cert` varchar(150) DEFAULT NULL COMMENT '营业执照证书',
  `scope_range` varchar(500) DEFAULT NULL COMMENT '经营范围',
  `tax_registration_code` varchar(150) DEFAULT NULL COMMENT '税务登记代码',
  `tax_registration_cert` varchar(150) DEFAULT NULL COMMENT '税务登记证',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业（个人）店铺信息认证表';

-- ----------------------------
-- Records of jc_store_info
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_level
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_level`;
CREATE TABLE `jc_store_level` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `level_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '店铺等级类型  1-第三方店铺等级类型  2-自营店铺等级类型（只能有一个）',
  `level_name` varchar(150) NOT NULL COMMENT '等级名称',
