  `upload_max_num` int(11) NOT NULL DEFAULT '0' COMMENT '图片空间数量上限',
  `exp` int(11) NOT NULL DEFAULT '0' COMMENT '升级信誉值',
  `sort_num` int(11) NOT NULL DEFAULT '10' COMMENT '排序',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺等级表';

-- ----------------------------
-- Records of jc_store_level
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_log
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_log`;
CREATE TABLE `jc_store_log` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '店铺id',
  `username` varchar(150) NOT NULL COMMENT '操作用户名',
  `client_ip` varchar(50) DEFAULT NULL COMMENT '客户端请求IP地址',
  `uri` varchar(150) DEFAULT NULL COMMENT '日志请求地址',
  `infos_type` varchar(150) DEFAULT NULL COMMENT '终端请求方式,普通请求,ajax请求',
  `method` varchar(20) DEFAULT NULL COMMENT '请求方式method,post,get等',
  `param_data` longtext COMMENT '请求参数内容,json',
  `session_id` varchar(150) DEFAULT NULL COMMENT '请求接口唯一session标识''',
  `infos_time` varchar(20) DEFAULT NULL COMMENT '请求时间',
  `returm_time` varchar(20) DEFAULT NULL COMMENT '接口返回时间',
  `http_status_code` varchar(20) DEFAULT NULL COMMENT '请求时httpStatusCode代码，如：200,400,404等',
  `time_consuming` int(11) DEFAULT '0' COMMENT '请求耗时（毫秒单位）',
  `menu_name` varchar(255) DEFAULT NULL COMMENT '操作菜单',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商家请求日志信息表';

-- ----------------------------
-- Records of jc_store_log
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_message
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_message`;
CREATE TABLE `jc_store_message` (
  `id` int(11) NOT NULL,
  `message_id` int(11) NOT NULL COMMENT '消息id',
  `store_id` int(11) NOT NULL COMMENT '商家id',
  `status` smallint(6) NOT NULL COMMENT ' status  1-已读   2-删除 ',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建用户',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改用户',
  `deleted_flag` tinyint(1) DEFAULT NULL COMMENT '删除标识 1-否 1-是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商家接收消息状态表';

-- ----------------------------
-- Records of jc_store_message
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_present
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_present`;
CREATE TABLE `jc_store_present` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '关联店铺id',
  `present_code` varchar(20) NOT NULL COMMENT '提现记录编号',
  `trade_no` varchar(150) DEFAULT NULL COMMENT '交易流水号,第三方平台的交易号',
  `store_name` varchar(150) NOT NULL COMMENT '店铺名称',
  `store_username` varchar(150) NOT NULL COMMENT '商家帐号',
  `money` decimal(12,2) NOT NULL COMMENT '提现金额',
  `account_type_code` varchar(50) NOT NULL COMMENT '提现账户类型',
  `account` varchar(50) NOT NULL COMMENT '账户',
  `account_username` varchar(50) DEFAULT NULL COMMENT '开户姓名',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '银行',
  `bank_name_ext` varchar(150) DEFAULT NULL COMMENT '开户支行',
  `finsh_time` datetime DEFAULT NULL COMMENT '完成转账时间',
  `status` smallint(6) NOT NULL DEFAULT '1' COMMENT '状态，1待审核；2审核不通过；3待转账；4转账失败；5完成',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '申请时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺提现记录表';

-- ----------------------------
-- Records of jc_store_present
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_product_category
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_product_category`;
CREATE TABLE `jc_store_product_category` (
  `id` int(11) NOT NULL,
  `store_id` int(11) NOT NULL COMMENT '店铺id',
  `cate_name` varchar(150) NOT NULL COMMENT '分类名称',
  `parent_id` int(11) DEFAULT NULL COMMENT '父id',
  `lft` smallint(6) NOT NULL COMMENT '分类树左边',
  `rgt` smallint(6) NOT NULL COMMENT '分类树右边',
  `sort_num` smallint(6) NOT NULL COMMENT '排序',
  `is_show` tinyint(1) NOT NULL COMMENT '是否显示',
  `is_top` tinyint(1) NOT NULL COMMENT '是否显示店铺导航栏',
  `title` varchar(150) DEFAULT NULL COMMENT '分类页标题',
  `keywords` varchar(500) DEFAULT NULL COMMENT '分类页关键词',
  `description` varchar(500) DEFAULT NULL COMMENT '分类页描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建用户',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改用户',
  `deleted_flag` tinyint(1) DEFAULT NULL COMMENT '删除标识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺商品分类';

-- ----------------------------
-- Records of jc_store_product_category
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_recharge
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_recharge`;
CREATE TABLE `jc_store_recharge` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '充值店铺id',
  `business_no` varchar(20) NOT NULL COMMENT '充值编号',
  `trade_no` varchar(255) DEFAULT NULL COMMENT '交易流水号',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `pay_type_code` varchar(50) DEFAULT NULL COMMENT '支付方式 1-支付宝  2-微信  3-银联',
  `account` varchar(50) NOT NULL COMMENT '充值账户',
  `blank_name` varchar(150) DEFAULT NULL COMMENT '开户行',
  `blank_name_ext` varchar(150) DEFAULT NULL COMMENT '开户支行',
  `account_username` varchar(50) DEFAULT NULL COMMENT '开户行姓名',
  `status` smallint(6) NOT NULL DEFAULT '1' COMMENT '状态（1待支付  2 未完成  3 已完成  4 已取消）',
  `finish_time` datetime DEFAULT NULL COMMENT '完成交易时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '充值时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '操作者',
  `update_time` datetime DEFAULT NULL COMMENT '操作时间',
  `create_user` varchar(150) DEFAULT NULL COMMENT '创建者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='店铺账户充值记录表';

-- ----------------------------
-- Records of jc_store_recharge
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_set
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_set`;
CREATE TABLE `jc_store_set` (
  `id` int(11) NOT NULL COMMENT '店铺ID',
  `theme_color` varchar(50) DEFAULT NULL,
  `inde_scroll_pic_id` int(11) DEFAULT NULL,
  `key_words` varchar(150) DEFAULT NULL COMMENT '店铺关键词',
  `description` varchar(150) DEFAULT NULL COMMENT '描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺设置表';

-- ----------------------------
-- Records of jc_store_set
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_settlement
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_settlement`;
CREATE TABLE `jc_store_settlement` (
  `id` int(11) NOT NULL COMMENT 'id',
  `business_number` char(18) NOT NULL COMMENT '业务单号(结算批次号)',
  `settlement_cycle_id` int(11) NOT NULL COMMENT '结算周期id',
  `store_id` int(11) NOT NULL COMMENT '商家id',
  `amount` decimal(12,2) NOT NULL COMMENT '结算金额',
  `status` tinyint(1) NOT NULL COMMENT '当前状态. 1:待商家确认 2:待平台审核 3:已结算',
  `orders` int(11) NOT NULL COMMENT '有效顶单数',
  `refund_orders` int(11) NOT NULL COMMENT '退款单数',
  `turnover_amount` decimal(12,2) NOT NULL COMMENT '成交金额',
  `integral_deduction_amount` decimal(12,2) NOT NULL COMMENT '积分抵扣金额',
  `integral_deduction_num` int(11) NOT NULL COMMENT '积分抵扣数量',
  `redenvelope_offset` decimal(12,2) NOT NULL COMMENT '红包抵扣金额',
  `redenvelope_offset_num` int(11) NOT NULL COMMENT '红包抵扣数量',
  `platform_coupon_offset` decimal(12,2) NOT NULL COMMENT '平台优惠券抵扣金额',
  `refund_amount` decimal(12,2) NOT NULL COMMENT '退款金额',
  `refund_score__amount` decimal(12,2) NOT NULL COMMENT '积分返还金额',
  `refund_score__num` int(11) NOT NULL COMMENT '积分返还数量',
  `refund_redenvelope_amount` decimal(12,2) NOT NULL COMMENT '红包返还金额',
  `refund_redenvelope_num` int(11) NOT NULL COMMENT '红包返还数量',
  `platform_refund_coupon` decimal(12,2) NOT NULL COMMENT '平台优惠券返还金额',
  `error_adjustment_total_amount` decimal(12,2) DEFAULT NULL,
  `error_adjustment_amount` decimal(12,2) NOT NULL COMMENT '异常调整金额',
  `error_adjustment_score` decimal(12,2) NOT NULL COMMENT '异常积分调整',
  `error_adjustment_redenvelope` decimal(12,2) NOT NULL COMMENT '异常红包调整',
  `error_adjustment_platform_coupon` decimal(12,2) NOT NULL COMMENT '平台优惠调整',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商家结算表';

-- ----------------------------
-- Records of jc_store_settlement
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_settlement_account
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_settlement_account`;
CREATE TABLE `jc_store_settlement_account` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `store_id` int(11) NOT NULL COMMENT '所属店铺id',
  `account_type` smallint(6) NOT NULL COMMENT '账户类型   1-支付宝   2-微信  3-银联',
  `account` varchar(150) NOT NULL COMMENT '账户',
  `bank_ext` varchar(150) DEFAULT NULL COMMENT '开户支行',
  `bank_name` varchar(150) DEFAULT NULL COMMENT '开户行',
  `account_name` varchar(150) DEFAULT NULL COMMENT '姓名',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建者',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改者',
  `deleted_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除标识。仅且仅有0和1两个值，1表示已经被逻辑删除，0表示正常可用。',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认 0-否  1-是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺结算账户表';

-- ----------------------------
-- Records of jc_store_settlement_account
-- ----------------------------

-- ----------------------------
-- Table structure for jc_store_settlement_cycle
-- ----------------------------
DROP TABLE IF EXISTS `jc_store_settlement_cycle`;
CREATE TABLE `jc_store_settlement_cycle` (
  `id` int(11) NOT NULL COMMENT '结算周期id标识',
  `beginTime` datetime DEFAULT NULL COMMENT '结算开始时间',
  `endTime` datetime NOT NULL COMMENT '结算结束时间',
  `last_order_refund_time` datetime NOT NULL COMMENT '当前结算周期最后一个有效订单确认收货时间',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
