  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `username` varchar(150) NOT NULL COMMENT '操作用户名',
  `client_ip` varchar(50) DEFAULT NULL COMMENT '客户端请求IP地址',
  `uri` varchar(150) DEFAULT NULL COMMENT '日志请求地址',
