DROP TABLE IF EXISTS `jc_sys_menu`;
CREATE TABLE `jc_sys_menu` (
  `id` int(11) NOT NULL COMMENT '全局唯一标识符',
  `platform_type` smallint(6) NOT NULL COMMENT '管理后台系统类型  1-平台管理  2-商家管理 ',
  `parent_id` int(11) DEFAULT NULL COMMENT '上级菜单id',
  `rgt` int(11) DEFAULT NULL COMMENT '分类树右边',
  `lft` int(11) DEFAULT NULL COMMENT '分类树左边',
  `menu_name` varchar(150) NOT NULL COMMENT '菜单名称',
  `routing_identifier` varchar(150) DEFAULT NULL COMMENT '路由标识（path）',
  `page_path` varchar(150) DEFAULT NULL COMMENT '页面路径',
  `access_identifier` varchar(150) DEFAULT NULL COMMENT '权限标识',
  `meta_value` varchar(150) DEFAULT NULL COMMENT 'meta值',
