  `id` int(11) NOT NULL COMMENT '主键',
  `title` varchar(150) NOT NULL COMMENT '信息标题',
  `content` varchar(500) NOT NULL COMMENT '内容',
  `mes_type` smallint(6) NOT NULL COMMENT '类型 1-系统消息  2-私信',
  `rec_target_type` smallint(6) NOT NULL COMMENT '接收对象类型  1-全部 2-用户组 3-商家等级 4-用户 5-商家',
  `memeber_group_id` int(11) DEFAULT NULL COMMENT '用户组id',
  `store_group_id` int(11) DEFAULT NULL COMMENT '商家等级id',
  `memeber_id_id` int(11) DEFAULT NULL COMMENT '用户id',
  `store_id` int(11) DEFAULT NULL COMMENT '商家id',
  `rec_all` tinyint(1) DEFAULT NULL COMMENT '接受对象是否为全部   0-否  1-是',
  `status` smallint(6) NOT NULL COMMENT '状态  1-正常  2-删除 ',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user` varchar(150) NOT NULL COMMENT '创建用户',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改用户',
  `deleted_flag` tinyint(1) DEFAULT NULL COMMENT '删除标识 1-否 1-是',
  PRIMARY KEY (`id`)
