  `ower_type` smallint(6) NOT NULL COMMENT '公众号拥有者类型 1-平台  2-商家',
  `store_id` int(11) DEFAULT NULL COMMENT '商家ID',
  `head_img` varchar(255) DEFAULT NULL COMMENT '头像',
  `global_id` varchar(50) NOT NULL COMMENT '原始ID',
  `app_id` varchar(50) NOT NULL COMMENT 'app_id',
  `grant_type` smallint(6) NOT NULL COMMENT '接入方式  1-授权接入',
  `wechat_name` varchar(150) NOT NULL COMMENT '公众号/小程序名称',
  `principal_name` varchar(255) NOT NULL COMMENT '公众号/小程序的主体名称',
  `wechat_type` smallint(6) NOT NULL COMMENT '公众号类型  1-普通订阅号（含历史老账号升级后的订阅号）  2-服务号',
  `verify_status` smallint(6) NOT NULL COMMENT '认证状态 1-r未认证 2-已认证',
