  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(150) DEFAULT NULL COMMENT '修改用户',
  `deleted_flag` tinyint(1) DEFAULT NULL COMMENT '删除标识 0-否  1-是',
