INSERT INTO `jc_sys_api` VALUES ('1090', '2', '修改一个菜单组', '/admin/store/wechatMenu/updateMenu', null, '10', '2', '修改一个菜单组的内容，判断菜单类型，如果是默认菜单则说明有两种修改方式，如果此菜单是开启状态则将此菜单发布到微信服务端，如果此菜单是关闭状态则只需修改本地数据库数据，如果是个性化菜单，则说明只有一种情况，则是此个性化菜单无生效，则只需修改本地数据库数据，微信服务端数据无需任何处理', '2019-03-10 16:18:56', null, 'admin', null, '0');
